sources.styles/blocks/_page.scss:
.page {

  &__content {
    font-family: 'Inter', sans-serif;
    font-weight: 400;
    background-color: $bg-color;
  }

  &__menu {
    position: fixed;
    top: 0;
    left: 0; 
    right: 0;
    transform: translateX(100%);
    transition: all 0.3s;

    &:target {
      transform: translateX(0);
    }
  }
}

sources.styles/blocks/_grid.scss:
.grid {
  display: grid;
  grid-template-columns: repeat($sm-col-count, $sm-col-size);
  column-gap: $sm-gap;

  &__sm{
    @for $start from 1 through $sm-col-count {
      @for $end from $start through $sm-col-count {
        &--#{$start}-#{$end} {
          grid-column: #{$start} / #{$end + 1};
        }
      }
    }
  }
}

sources.styles/blocks/_header.scss:
.header {
  &__container {
    display: flex;
    justify-content: space-between;
    align-items: center;
    height: 64px;
  }

  &__logo-link {
    width: 136px;
    height: 32px;
  }

  &__logo {
    width: 100%;
    height: 100%;
  }

  &__menu-opener {
    width: 24px;
    height: 24px;
  }

  &__menu-img {
    width: 100%;
    height: 100%;
  }

  &__nav {
    display: none;
  }
}

sources.styles/blocks/_nav.scss:
.nav {
  &__item {
    width: max-content;
    margin: 0 auto 24px;

    &:last-child {
      margin-bottom: 0;
    }

    &--footer {
      width: 100%;
      margin: 0 0 16px;
    }
  }

  &__link {
    font-weight: 400;
    font-size: 16px;
    line-height: 150%;
    text-align: center;
    letter-spacing: -0.01em;
    color: $black-color;
    text-decoration: none;

    &--color--default {
      font-weight: 500;
      line-height: 100%;
      letter-spacing: 0.02em;
      text-transform: uppercase;
      color: $default-color;
    }

    &--color--white {
      text-align: left;
      color: $white-color;
    }
  }

  &__link-container {
    display: flex;
    align-items: center;
  }

  &__link-img {
    width: 24px;
    height: 24px;
    margin-right: 4px;
  }

}

sources.styles/blocks/_hero.scss:
.hero {

  &__container {
    padding-top: 32px;
    padding-bottom: 40px;
  }

  &__text {
    grid-column: 1 / 3;
    font-size: 16px;
    line-height: 150%;
    text-align: center;
    letter-spacing: -0.01em;
    color: $black-color;
    margin-bottom: 16px;
  }

  &__title {
    grid-column: 1 / 3;

    font-size: 64px;
    line-height: 85%;
    text-align: center;
    font-weight: 400;
    letter-spacing: -0.05em;
    text-transform: uppercase;
    color: $default-color;
  }

  &__img {
    grid-column: 1 / 3;
    width: 100%;
  }

  &__button {
    grid-column: 1 / 3;
    display: flex;
    justify-content: center;
    align-items: center;
    width: 100%;
    height: 56px;
    border: 2px solid $default-color;
    border-radius: 32px;
    margin: 0 auto;
    text-decoration: none;

    font-weight: 500;
    font-size: 16px;
    line-height: 100%;
    letter-spacing: 0.02em;
    text-transform: uppercase;
    color: $default-color;
  }

  &__button-img {
    width: 24px;
    height: 24px;
    margin-right: 4px;
  }

  &__button-text {

  }
}

